import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React, { useState } from "react";
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import DeleteIcon from '@mui/icons-material/Delete';
import BuildIcon from '@mui/icons-material/Build';


function Manager(){

    const [rows, setRows] = useState([{
        order_id: "1",
        order_date: "Mon Dec 12",
        total_cost: 100200,
        member_name: "Ian1", 
        state: "배송중",
    },
    {
        order_id: "2",
        order_date: "Feb May 21",
        total_cost: 99800,
        member_name: "Ian2", 
        state: "취소요청",
    },
    {
        order_id: "3",
        order_date: "Wed Jul 21",
        total_cost: 399800,
        member_name: "Ian3", 
        state: "취소요청",
    },
    {
        order_id: "4",
        order_date: "Thu Dec 23",
        total_cost: 499800,
        member_name: "Ian4", 
        state: "교환요청",
    },
    {
        order_id: "5",
        order_date: "Thu Jan 27",
        total_cost: 9649800,
        member_name: "Ian5", 
        state: "배송중",
    },
    {
        order_id: "6",
        order_date: "Mon May 21",
        total_cost: 99800,
        member_name: "Ian6", 
        state: "교환요청",
    },
    ])

    const onClick = (e) =>{
        if(e.target.id === "modify"){

        }
        else if(e.target.id ==="delete"){
            alert("삭제되었습니다.")
        }
    }

    return(
        <Box sx={{
            display: "grid",
            gap: "3rem",
            width:"90%",
            margin: "auto",
            gridTemplateAreas: `"sidebar main"`,
            gridTemplateColumns: "1fr 4fr"                 
           }}>
                <Box sx={{ gridArea: 'sidebar' , border:1 , display:'flex' , alignItems:'left'}}>
                    <Typography variant="h5" sx={{ mr : 5}}>주문내역 확인</Typography>
                    <ArrowForwardIosIcon fontSize="large"/>
                </Box>
                <Box sx={{ gridArea: 'main', border:1 ,height:"300px"}}>

                <TableContainer component={Paper}>
                    <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
                        <TableHead>
                        <TableRow>
                            <TableCell sx={{ backgroundColor:'lightgray' , border:0,borderRight:1 , borderColor:'darkGray', width:"30%"}}>주문번호</TableCell>
                            <TableCell sx={{ backgroundColor:'lightgray' , border:0, borderRight:1 , borderColor:'darkGray', width:"30%"}}>주문일</TableCell>
                            <TableCell align="center">주문합계</TableCell>
                            <TableCell align="center">이름</TableCell>
                            <TableCell align="center">주문상태</TableCell>
                            <TableCell align="center">수정/삭제</TableCell>
                        </TableRow>
                        </TableHead>
                        <TableBody>
                        {rows.map((row,index) => (
                            <TableRow key={index} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                            <TableCell component="th" scope="row">
                                {row.order_id}
                            </TableCell>
                            <TableCell>{row.order_date}</TableCell>
                            <TableCell align="center">{row.total_cost}</TableCell>
                            <TableCell align="center">{row.member_name}</TableCell>
                            <TableCell align="center">{row.state}</TableCell>
                            <TableCell align="center"> 
                            <Box  sx={{display:'flex' , alignItems:'center' , justifyContent:'center' ,color:'gray'}}>
                                <BuildIcon id="modify" onClick={onClick} fontSize="small"/> 
                                <DeleteIcon id="delete" onClick={onClick} /> 
                            </Box>
                            </TableCell>

                            </TableRow>
                        ))}
                        </TableBody>
                    </Table>
                    </TableContainer>
                </Box>
        </Box>

    );
}

export default Manager;
